import React from 'react';
// import PropTypes from 'prop-types';
import { connect } from 'react-redux';

const ListUsers = ({ users }) => (
    <ul>
      {users.map((user) => (
        <li key={user.id}>
          {user.title}
        </li>
      ))}
    </ul>
)

const mapStateToProps = (state) => (
  { data: state.users }
)

export default connect(mapStateToProps)(ListUsers);
